import Header from './Header';
import Footer from './Footer';
import '../static/scss/App.scss'
const Layout = ({children}) => {
    return (
        <React.Fragment>
            <Header/>
            <p className="example">Test</p>
            {children}
            <Footer/>
        </React.Fragment>
    )
}

export default Layout;
